 return token;
}

lexer\_T \*init\_lexer(char \*contents)
{
 lexer\_T \*lexer = calloc(1, sizeof(lexer\_T));
 lexer->contents = contents;
 lexer->i = 0;
 lexer->c = contents[lexer->i];

 return lexer;
}

void lexer\_advance(lexer\_T \*lexer)
{
 if (lexer->c != '\0' && lexer->i < strlen(lexer->contents))
 {
 lexer->i += 1;
 lexer->c = lexer->contents[lexer->i];
 }
}

#define MAX\_TOKEN\_LENGTH 100

token\_T \*get\_next\_token(lexer\_T \*lexer)
{
 int input\_length = strlen(lexer->contents);
 char current\_word[MAX\_TOKEN\_LENGTH];
 int word\_index = 0;
 while (lexer->i < input\_length)
 {
 char c = lexer->contents[lexer->i];
 if (c == ' ' || c == '\t')
 {
 lexer\_advance(lexer);
 continue;
 }
 else if (c == ';')
 {
 lexer\_advance(lexer);
 return init\_token(";", TOKEN\_SEMICOLON);
 }
 else if (c == '\n')
 {
 lexer\_advance(lexer);
 return init\_token("\n", TOKEN\_NEWLINE);
 }
 else if (c == '\'')
 {
 lexer\_advance(lexer);
 return init\_token("'", TOKEN\_APOSTROPHE);
 }
 else if (strncmp(lexer->contents + lexer->i, "if", 2) == 0)
 {
 lexer\_advance(lexer);
 return init\_token("if", TOKEN\_IF);
 }
 else if (strncmp(lexer->contents + lexer->i, "then", 4) == 0)
 {
 lexer\_advance(lexer);
 return init\_token("then", TOKEN\_THEN);
 }
 else if (strncmp(lexer->contents + lexer->i, "elif", 4) == 0)
 {
 lexer\_advance(lexer);
 return init\_token("elif", TOKEN\_ELIF);
 }
 else if (strncmp(lexer->contents + lexer->i, "else", 4) == 0)
 {
 lexer\_advance(lexer);
 return init\_token("else", TOKEN\_ELSE);
 }
 else if (strncmp(lexer->contents + lexer->i, "fi", 2) == 0)
 {
 lexer\_advance(lexer);
 return init\_token("fi", TOKEN\_FI);
 }
 else if (c == '"')
 {
 lexer\_advance(lexer);
 int start = lexer->i;
 while (lexer->contents[lexer->i] != '"' && lexer->i < input\_length)
 {
 lexer\_advance(lexer);
 }
 if (lexer->i < input\_length)
 {
 lexer\_advance(lexer);
 return init\_token(strndup(lexer->contents + start, lexer->i - start - 1), TOKEN\_STRING);
 }
 else
 {
 // Error case, unterminated string
 }
 }
 else
 {
 current\_word[word\_index++] = c;
 lexer\_advance(lexer);
 }
 }
 return init\_token("EOF", TOKEN\_EOI);
}

