\subsection{Global State Evaluation}
\paragraph{Definition}
When human players play StarCraft II, they usually have a sense of whether they would win or lose in the current state.
Such a sense is essential for the decision making of what to train or build in the following steps.
For AI bots, it's also desirable to have the ability of predicting the probability of winning in a certain state.
Such an ability is called global state evaluation in StarCraft community.
Formally, global state evaluation is predicting the probability of winning given current state at time step $t$, \ie predicting the value of $P(R=win|x\_t)$.
$x\_t$ is the state at time step $t$ while $R$ is the final result.
Usually, $x\_t$ couldn't be accessed directly, what we obtain is the observation of $x\_t$ noted as $o\_t$.
Thus, we use $o\_1, o\_2, ..., o\_t$ to represent $x\_t$ and try to learn a model for predicting $P(R=win|o\_1, o\_2, ..., o\_t)$ instead.
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
\begin{figure}[t]
\begin{center}
 \includegraphics[width=\linewidth]{images/BASELINE}
\end{center}
 \caption{\textbf{Baseline network architecture.} $o\_t$ is the input feature vector. A, B and E are linear units with the number of units 1024, 2048 and 1, while C and D are GRUs with size 2048 and 512.}
 \label{fig:baseline}
\end{figure}
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
\paragraph{Baseline Network}
% \paragraph{Architecture}
We model global state evaluation as a sequence decision making problem and use Recurrent Neural Networks (RNNs)~\cite{mikolov2010recurrent} to learn from replays.
Concretely, we use GRU~\cite{cho2014properties} in the last two layers to model the time series $o\_1, o\_2, ..., o\_t$.
As shown in Figure~\ref{fig:baseline}, the feature vector $o\_t$ flows through linear units A and B with size 1024 and 2048.
Then two GRUs C and D with size 2048 and 512 are applied.
The hidden state from D is fed into the linear unit E followed by a Sigmoid function to get the final result $r\_t$.
ReLUs are applied after both A and B.
\paragraph{Objective Function}
Binary Cross Entropy Loss (BCE) serves as our objective function, which is defined as Equation~\ref{equation:bce},
 \begin{equation}\label{equation:bce}
 \begin{aligned}
 J(\Omega\_t, R\_t) = -& log(P(R=1|\Omega\_t))\cdot R\_t \\
 -& log(P(R=0|\Omega\_t))\cdot (1 - R\_t)
 \end{aligned}
 \end{equation}
where $\Omega\_t$ stands for $o\_1, o\_2, .., o\_t$ and $R\_t = R$ is the final result of a match.
We simply set $R$ to be 1 if the player wins at the end and set it to be 0 otherwise.
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
\vspace{-1em}
\paragraph{Experiment Results}
The baseline network is trained on our dataset using global feature vector and evaluated with mean accuracy.
We report the results of all replays in Table~\ref{table:map}, serving as the baseline results for global state evaluation in MSC.
For Terran versus Terran matches, the mean accuracy in test set is 61.1\% after model converges. 
We also show the mean accuracies of different game phrases in Figure~\ref{fig:map}.
At the beginning of the game (0\%-25\%), it's hard to tell the probability of winning, as the mean accuracy of this curve is 52.9\%.% and doesn't change much with the training progressing.
After half of the game (50\%-75\%), the mean accuracy could reach 64.2\%, while it's around 79.7\% at the end of the game (75\%-100\%).

